import { useEffect, useState } from "react";
import UseJobSeekerContext from "../../hooks/UseJobSeekerContext"; 
import Navbar from "../../components/Navbar";
import "./index.css";

const JobSeekerProfile = () => {
  const idJobSeeker = "66d075786842d41103d96dd1";
  const { dispatch } = UseJobSeekerContext();
  const [jobseeker, setJobseeker] = useState({
    name: "",
    email: "",
    cv: "",
    phone: "",
    address: "",
    skills: [],
    education: [],
    experience: [],
  });

  useEffect(() => {
    const fetchJobSeeker = async () => {
      try {
        const response = await fetch(
          `/API/jobseeker/single-jobseeker/${idJobSeeker}`
        );
        const data = await response.json();

        if (data) {
          setJobseeker(data);
          dispatch({ type: "SET_JOBSEEKER", payload: data });
        } else {
          console.error("Failed to Set JobSeeker:", data.message);
        }
      } catch (e) {
        console.error("Error fetching jobseeker:", e);
      }
    };
    fetchJobSeeker();
  }, [dispatch]);

  return (
    <>
      <Navbar />
      <div className="jobseeker-profile">
        <div>
          <p>Name: {jobseeker.name}</p>
          <p>CV:{jobseeker.cv}</p>
          <p>Email: {jobseeker.email}</p>
          <p>Phone: {jobseeker.phone}</p>
          <p>Address: {jobseeker.address}</p>
          <p>Skills: {jobseeker.skills.join(", ")}</p>
          <p>Education: {jobseeker.education.join(", ")}</p>
          <p>Experience: {jobseeker.experience.join(", ")}</p>
        </div>
      </div>
    </>
  );
};

export default JobSeekerProfile;
